import React from 'react'
import Navbar from './Navbar'
import FilterCard from './FilterCard'
import Job from './Job'
import { useSelector } from 'react-redux';

function Jobs() {
  const jobsArray = [1, 2, 3, 4, 5, 6, 7, 8];
  const { allJobs } = useSelector(store => store.job)
  return (
    <div className='pt-3'>
      <Navbar />
      <div className='m-3'>
        <div className='d-flex gap-3'>
          <div className='my-3'>
            <FilterCard />
          </div>
          <div>
            {
              allJobs.length < 0 ? <span>Job jot found</span> : (
                <div className=''>
                  {
                    jobsArray.map((job) =>
                      <div className='jobcards my' key={job?._id}>
                        <Job job={job} />
                      </div>
                    )
                  }
                </div>
              )
            }
          </div>
        </div>
      </div>
    </div>
  )
}

export default Jobs
